import React, { useState } from 'react'
import './App.css'
function Todos({ todo, index }) {
  return (
      <h1>{todo.text}</h1>
  );
}



function App() {
  const [todos, setTodos] = useState([
    { text: "lorem  ipsum1" },
    { text: "lorem  ipsum2" },
    { text: "lorem  ipsum3" },

  ]);
  return (
    <div className="App">
      <header className="App-header">
        <h1>Reactors</h1>
        {todos.map((todo, index) => {
          <Todos key={index} todo={todo} index={index} />
        })}
      </header>
    </div>
  );
}

export default App;
